{
	return vLedPositions;
}

export function Initialize()
{
	keepAliveTimer = Date.now();
	
	device.set_endpoint(0,1,0x000C,0);
	
	var packet = new Array(91).fill(0);
	packet[2] = 0x1F;
	packet[6] = 0x02;
	packet[8] = 0x84;
	packet[89] = CalculateCrc(packet);
	device.send_report(packet, 91);
	
	packet[8] = 0x04;
	packet[9] = 0x03;
	packet[89] = CalculateCrc(packet);
	device.send_report(packet, 91);
	
	packet[2] = 0x08;
	packet[8] = 0x86;
	packet[9] = 0x00;
	packet[89] = CalculateCrc(packet);
	device.send_report(packet, 91);
	
	SetupChannels();
}

export function Shutdown()
{
	for(let i = 0; i < ChannelArray.length; i++)
	{
		SendChannel(i,true);
	}
}

function SendChannel(Channel, shutdown = false)
{
	let ChannelLedCount = device.channel(ChannelArray[Channel][0]).ledCount;

	let RGBData = [];
	if(shutdown)
	{
		RGBData = device.createColorArray(shutdownColor, ChannelLedCount, "Inline");
	}
	else if(LightingMode == "Forced")
	{
		RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline");
	}
	else if(device.getLedCount() == 0)
	{
		ChannelLedCount = 80;
		let pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
		RGBData = device.createColorArray(pulseColor, ChannelLedCount, "Inline");
	}
	else
	{
		RGBData = device.channel(ChannelArray[Channel][0]).getColors("Inline");
	}
	
	device.set_endpoint(1,1,0x000C,0);
	
	var packet = [];		 
	packet[0] = 0x00;
	packet[1] = Channel == 2 ? 0x84 : 0x04;
	packet[2] = Channel;
	packet[3] = Channel;
	packet[4] = 0x00;
	packet[5] = 0x77;
	packet = packet.concat(RGBData);
	device.send_report(packet, 381);
	device.pause(10);
}

function KeepAlive()
{
	if (Date.now() - keepAliveTimer < keepAlivePause)
	{
		return
	}
	keepAliveTimer = Date.now();
	
	device.set_endpoint(0,1,0x000C,0);
	
	var packet = new Array(91).fill(0);
	packet[0] = 0x00;
	packet[2] = 0x1F;
	packet[6] = 0x06;
	packet[7] = 0x0F;
	packet[8] = 0x02;
	packet[11] = 0x08;
	packet[12] = 0x01;
	packet[13] = 0x08;
	packet[89] = CalculateCrc(packet);
	device.send_report(packet, 91);
}
	
function CalculateCrc(packet)
{
	var iCrc = 0;
	for (var iIdx = 3; iIdx < 89; iIdx++)
	{
		iCrc ^= packet[iIdx];
	}
	return iCrc;
}

export function Render()
{
	for(let i = 0; i < ChannelArray.length; i++)
	{
		SendChannel(i);
	}
	KeepAlive();
}

export function Validate(endpoint)
{
	return endpoint.interface === 1 || endpoint.interface === 0;

}

